function convertToPointCloud() {
    const suzanne = scene.getObjectByName('Suzanne');
    if (!suzanne) return console.error('Suzanne object not found');

    scene.remove(suzanne);

    const geometry = suzanne.geometry.clone();
    const positions = geometry.attributes.position.array;

    const pointPositions = [];
    const colors = [];
    const expansionDirections = [];
    const pointPhases = [];

    // Generate points with strictly one point per vertex
    for (let i = 0; i < positions.length; i += 3) {
        const offsetX = (Math.random() - 0.5) * 0.05;
        const offsetY = (Math.random() - 0.5) * 0.06;
        const offsetZ = (Math.random() - 0.5) * 0.05;

        pointPositions.push(
            positions[i] + offsetX,
            positions[i+1] + offsetY,
            positions[i+2] + offsetZ
        );

        colors.push(
            Math.random() * 0.5 + 0.5,
            Math.random() * 0.5 + 0.5,
            Math.random() * 0.5 + 0.5
        );

        expansionDirections.push(
            (Math.random() - 0.5) * 0.5,
            (Math.random() - 0.5) * 0.5,
            (Math.random() - 0.5) * 0.5
        );
        pointPhases.push(Math.random() * Math.PI * 2);
    }

    // Geometry setup
    const pointGeometry = new THREE.BufferGeometry();
    pointGeometry.setAttribute('position', new THREE.Float32BufferAttribute(pointPositions, 3));
    pointGeometry.setAttribute('color', new THREE.Float32BufferAttribute(colors, 3));

    const pointMaterial = new THREE.PointsMaterial({
        size: 0.009,
        vertexColors: true,
        blending: THREE.AdditiveBlending,
        transparent: true,
        opacity: 0.8
    });

    const pointCloud = new THREE.Points(pointGeometry, pointMaterial);
    pointCloud.name = 'SuzannePointCloud';
    scene.add(pointCloud);

    // Interaction setup for both mouse and touch
    const mouse = new THREE.Vector2();
    const raycaster = new THREE.Raycaster();
    let interactionEnabled = true;

    let lastX = 0;
    let lastY = 0;
    let isDragging = false;

    function handleStart(event) {
        event.preventDefault();
        isDragging = true;
        const touch = event.touches ? event.touches[0] : event;
        lastX = touch.clientX;
        lastY = touch.clientY;
    }

    function handleMove(event) {
        if (!isDragging) return;
        event.preventDefault();
        const touch = event.touches ? event.touches[0] : event;
        const deltaX = touch.clientX - lastX;
        const deltaY = touch.clientY - lastY;

        const rotationSpeed = 0.005;
        pointCloud.rotation.y += deltaX * rotationSpeed;
        pointCloud.rotation.x += deltaY * rotationSpeed;

        lastX = touch.clientX;
        lastY = touch.clientY;

        // Update mouse position for interaction
        mouse.x = (touch.clientX / window.innerWidth) * 2 - 1;
        mouse.y = - (touch.clientY / window.innerHeight) * 2 + 1;
    }

    function handleEnd(event) {
        isDragging = false;
    }

    window.addEventListener('mousedown', handleStart, false);
    window.addEventListener('touchstart', handleStart, false);
    window.addEventListener('mousemove', handleMove, false);
    window.addEventListener('touchmove', handleMove, false);
    window.addEventListener('mouseup', handleEnd, false);
    window.addEventListener('touchend', handleEnd, false);

    let animationFrame = 0;
    function animatePoints() {
        requestAnimationFrame(animatePoints);

        const positions = pointCloud.geometry.attributes.position;

        if (interactionEnabled) {
            // Create a world-space mouse position
            const mouseWorldPosition = new THREE.Vector3();
            raycaster.setFromCamera(mouse, camera);
            raycaster.ray.at(3.5, mouseWorldPosition);  // Project ray 5 units into the scene

            for (let i = 0; i < pointPositions.length; i += 3) {
                const expansionIntensity = Math.sin(animationFrame * 0.05 + pointPhases[i/3]) * 0.05;

                const xExpansion = expansionDirections[i] * expansionIntensity;
                const yExpansion = expansionDirections[i+1] * expansionIntensity;
                const zExpansion = expansionDirections[i+2] * expansionIntensity;

                // Create a point in world space for comparison
                const point = new THREE.Vector3(
                    pointPositions[i], 
                    pointPositions[i+1], 
                    pointPositions[i+2]
                ).applyMatrix4(pointCloud.matrixWorld);

                let mouseInteractionOffset = new THREE.Vector3(0, 0, 0);

                // Check distance in world space
                const distance = point.distanceTo(mouseWorldPosition);

                if (distance < 1) {
                    const repelFactor = (1 - distance) * 0.4;
                    const direction = point.sub(mouseWorldPosition).normalize();
                    mouseInteractionOffset = direction.multiplyScalar(repelFactor);
                }

                positions.array[i] = pointPositions[i] + xExpansion + mouseInteractionOffset.x;
                positions.array[i+1] = pointPositions[i+1] + yExpansion + mouseInteractionOffset.y;
                positions.array[i+2] = pointPositions[i+2] + zExpansion + mouseInteractionOffset.z;
            }

            positions.needsUpdate = true;
        }

        animationFrame++;
    }

    animatePoints();
}

convertToPointCloud();
